import React from "react";
import "../../App.css";
import styled from "styled-components";

const Button = styled.button`
  background: #891C1A;
  border-radius: 23px;
  border: none;
  color: white;
  height:45px;
  padding: 0 10px;
`;

export default function Login() {
  return (
    <div style={{ flex: 1, justifyContent: "center", alignContent: "center" }}>
      <Button>I'm purple.</Button>
    </div>
  );
}
